import styled from 'styled-components'

export const StyledHeader = styled.div`
font-family: 'Avenir Next Bold';
background-color:#43E895;
color:#ffffff;
font-size:17px;
`
export const StyledIcon = styled.img`
src: ${props => props.src};
width: 20px;
margin:20px;
float: ${props => props.float}
`
